import './App.css';
import axios from 'axios'
import { useState } from 'react';
import { Button, Col, Container, Row } from 'react-bootstrap'
import { RiMoneyDollarCircleLine } from 'react-icons/ri';

function App() {

  const [properties, setProperties] = useState([])
  const [displayResult, setDisplayResult] = useState('none')

  const handleSubmit = async (event) => {
    event.preventDefault()
    await axios.get('http://localhost:8000/huurwoningen/')
      .then(response => {
        setProperties(response.data)
        setDisplayResult('block')
        console.log(response.data)
      })
      .catch(error => {
        console.log('not worked')
        setProperties(['not good'])
      })
  }

  return (
    <Container>
      <h1 style={{textAlign: 'center'}}>Huurwoningen's listings </h1>
      <div className="d-flex align-items-center justify-content-center">
        <Button onClick={handleSubmit} variant="dark">Press me!</Button>        
      </div>
      <Row>
        {properties.map((element, index) => {
          return(
            <Col md={3} key={index}>
              <Card>
                <Card.Body>
                  <Card.Title>
                    <a href={element[1]} style={{color: '#000', textDecoration: 'none'}}>
                      {element[0]}
                    </a>
                  </Card.Title>
                  <Card.Text>
                    <p>
                      <RiMoneyDollarCircleLine size={20} style={{ verticalAlign: 'middle', marginRight: '5px' }} />
                      {element[2]}
                    </p>
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          )
        })}
      </Row>
    </Container>
  );
}

export default App;
